*CAROS AMIGOS, QUEM QUISER ME EXCLUIR, VOU AJUDAR!*
•Sou de direita
•Apoio o Bolsonaro
•Lula é ladrão;
• Não gosto dos partidos do PT,  PSOL, PC do B e por aí...
•As universidades públicas estão infestadas de comunistas;
•Bandido não é vítima da sociedade;
•Pedofilia não é doença, é crime;
•Sou pró-família
Sou a favor do trabalho do detento
•Sou contra a erotização de crianças;
•Sou a favor de acabar com todo e qualquer privilégio da classe política;
•Cotas, só se for cota social (pobreza);
Sou a favor da Lei Maria da Penha e do Zé Coitado;
•Direitos humanos devem ter o foco na vítima, bandido tem lei carcerária para ser cumprida;
•Policiais e professores deveriam ganhar mais do que deputados e senadores, mas para PRENDER e  ENSINAR e não para fazer política;
•O feminismo NÃO protege a mulher;
•Sou contra o aborto;
•Pra mim só existe uma raça, a humana; logo, somos todos iguais;
•Sou anti-vitimistas;
•Sou a favor da prisão após condenação em segunda instância;
•Sou a favor do porte de arma para cidadão de bem;
•Sobre casamento CÍVIL entre gays e lésbicas, quem tem que aceitar é quem foi pedido em casamento ou namoro, eu sou aquele que RESPEITA;
Sou a favor de que, para ser Presidente da República, tenha que estudar para tal;
•Merthiolate tem que arder,
•Sou a favor do fim da maioridade penal. Se tem idade pra cometer crime, tem idade pra pagar por ele
• E a Globo é um lixo!
